@burtonad @BEERG @IanDunt I was always amused by the "UK becomes EU's biggest market" claim by Brexiters.

In reality, the EU's internal market shrank by some 15%, and the internal market of the UK by a whopping 85%.

Our biggest markets, outside of the EU, of course, are the US, and China.
